import React, {Component} from 'react';
import {Form, Button, Modal, Header, Icon,Divider,Grid,Segment} from 'semantic-ui-react';
import {withRouter} from 'react-router-dom';
import firebaseConf from './Firebase'

class Logout extends Component {
  constructor() {
    super();
    this.state = {isLoading: false, openDisapprovedModal: false,electionStatus:[]};
  }
  handleSubmit = () => {
    this.setState({isLoading: true});
    this.props.history.push({pathname: '/login-admin'});
    this.setState({isLoading: false});
    sessionStorage.removeItem('USERNAME')
  };
  handleOpenDisapprovedModal = () => {
    this.setState({openDisapprovedModal: true});
  };

  handleCloseDisapprovedModal = () => {
    this.setState({openDisapprovedModal: false});
  };
  changePassword = () => {
    this.props.history.push({
      pathname: '/change-password',
    });
  };
  // disableElection=()=>{

  // }
componentDidMount(){
  this.fetchElectionButton()
}
fetchElectionButton=()=>{
  firebaseConf.database().ref('election').on('value',snapshot=>{
    const electionStatus=[]
    snapshot.forEach(data=>{
      const electionStatusNew={
        electionEnabled:data.val()
        }
      electionStatus.push(electionStatusNew)
      this.setState({electionStatus})
      })
      console.log(this.state.electionStatus)
    })
    
  }


  render() {
    return (
      <div>
        <Segment placeholder color="white">
          <Grid columns={4} stackable textAlign="center">
            {/* <Container> */}
            <Grid.Row verticalAlign="middle">
              <Grid.Column>
                <Header icon>
                  <Icon name="user circle" />
                  Logout
                </Header>
                <Button color="red" onClick={this.handleOpenDisapprovedModal}>
                  Logout
                </Button>
              </Grid.Column>
              <Divider vertical />
              <Grid.Column>
                <Header icon>
                  <Icon name="registered" />
                  Change Admin password
                </Header>
                <Button color="yellow" onClick={() => this.changePassword()}>
                  Change  password
                </Button>
              </Grid.Column>
              <Divider vertical />
              <Grid.Column>
                <Header icon>
                  <Icon name="users" />
                  Disable Election process
                </Header>
                <Button color="blue" >
                  Disable Election process
                </Button>
              </Grid.Column>
               <Grid.Column>
                <Header icon>
                  <Icon name="users" />
                   Disable Register
                </Header>
                <Button color="blue" >
                  Disable Register 
                </Button>
              </Grid.Column>
              <Divider vertical />
              <Grid.Column>
                <Header icon>
                  <Icon name="erase" />
                  Disable Register Aspirant
                </Header>
                <Button color="green" >
                Disable Register Aspirant

                </Button>
              </Grid.Column>
            </Grid.Row>
            {/* </Container> */}
          </Grid>
        </Segment>

        <div>
          <Modal
            open={this.state.openDisapprovedModal}
            onClose={this.handleCloseDisapprovedModal}
            basic
            size="small"
            style={{minHeight: '100vh'}}
          >
            <Header icon="sign-out" content="Logout Confirmation" />
            <Modal.Content>
              <p>Are you sure you want to Logout {this.state.post}</p>
            </Modal.Content>
            <Modal.Actions>
              <Button
                basic
                color="red"
                inverted
                onClick={this.handleCloseDisapprovedModal}
              >
                <Icon name="remove" /> No
              </Button>
              <Button
                color="green"
                onClick={this.handleSubmit}
                loading={this.state.isLoadingisLoading}
              >
                <Icon name="checkmark" /> Yes
              </Button>
            </Modal.Actions>
          </Modal>
        </div>
      </div>
    );
  }
}

export default withRouter(Logout);
